CREATE TABLE `Gallery` (
  `id` int not null auto_increment  ,
  `createdAt` datetime  not null ,
  `updatedAt` datetime  ,
  `name` varchar(764)  not null ,
  `description` text   default NULL,
  `mediaId` varchar(764)   default NULL,
  `url` varchar(764)   default NULL,
  `custodian` varchar(764)   default NULL,
  `userId` int  default 0,
  `content` varchar(764)  not null ,
  `highlightImage` varchar(764)   default NULL,
  `imagePaths` text   default NULL,
  `isMature` tinyint not null  default 0,Primary key(`id`),Unique key `Gallery_id_key`(`name`(200))
 )ENGINE=innodb COLLATE=utf8mb4_unicode_ci;

